import React from 'react'
import styled from "styled-components"
import Nav from "./Nav";
import Box from "../assets/box.jpeg"

const Wrapper = styled.div`
img{
    width: 100%;
    max-height: 50%
}
.content{
    position: absolute;
    top: 0;
    z-index: -1
}
`

function About() {
    return (
      <Wrapper>
          <Nav style={{ position: "absolute", zIndex: 2 }} />
        <div className="content">
            <img src={Box} alt=""/>
            <div className="text">
                <h1></h1>
            </div>
        </div>
      </Wrapper>
    );
}

export default About
